const items = [
  {
    name: 'General',
    color: '#757575',
    href: 'img/icomoon/sprite.svg#icon-library',
  },
  {
    name: 'Mathematics',
    color: '#1E88E5',
    href: 'img/icomoon/sprite.svg#icon-stats-dots',
  },
  {
    name: 'Nature',
    color: '#4CAF50',
    href: 'img/icomoon/sprite.svg#icon-leaf',
  },
  {
    name: 'Sports',
    color: '#F44336',
    href: 'img/icomoon/sprite.svg#icon-sports_soccer',
  },
  {
    name: 'Random',
    color: '#9C27B0',
    href: 'img/icomoon/sprite.svg#icon-random',
  },
];
const RecentActivity = function () {
  return (
    <div className="!mt-[2rem]">
      <h3 className="text-[1.2rem] !mb-[1rem]">Recent Activity</h3>
      <ul>
        <Activity />
      </ul>
    </div>
  );
};
const Activity = function () {
  return (
    <li role="button" className="flex gap-2 items-center">
      <figure className="!p-[.5rem_1.5rem] bg-[#ABC2E3]">
        <svg className={`w-[3rem] h-[3rem] fill-[${items.at(0).color}]`}>
          <use href={items.at(0).href}></use>
        </svg>
      </figure>
      <div className="grid">
        <span className=" uppercase">{items.at(0).name}</span>
        <span className="text-[.8rem]">50 Questions </span>
      </div>
      <span
        className={`!ml-auto rounded-[50%] bg-[${
          items.at(0).color
        }] aspect-[1] !p-[1rem] grid`}
      >
        20/30
      </span>
    </li>
  );
};
export default RecentActivity;
